import React from "react";
import "./Post.css";
import Avatar from "@material-ui/core/Avatar";

function Post() {
	return (
		<div className="post">
			<Avatar
				className="post__avatar"
				alt="Yabacoder"
				src="/static/images/1.jpg"
			/>
			<h3>Username</h3>
			{/** header -> avatar + username */}

			<img src="" alt="" className="post__image" />
			{/** image */}
			<h4>
				<strong>Username:</strong> caption
			</h4>
			{/** username + caption */}
		</div>
	);
}

export default Post;
